export default function Select({ selectArr }) {
    return (
        <>
            <select
                className="select"
                value={select} onChange={(e) => setSelect({ currency: e.target.value })}>
                {
                    selectArr.map(item => {
                        <option>`${item.cc} - ${item.txt}`</option>
                    })
                }
                <option>USD</option>

            </select>
        </>
    )
}

